import { useState, useEffect } from 'react';
import './App.css';

function VideoArray() {
  const [data, setData] = useState(null);
  const [arr, setArr] = useState(null);


  useEffect(() => {
    fetch("/videos")
      .then((res) => res.json())
      .then((data) => setData(data.message))
  }, []);

  console.log(data);

  return (
      <div>{!data ? "Loading..." : data.split(",")}</div>
  );
}

function App() {
  const [data, setData] = useState(null);
  var icon = null;

  useEffect(() => {
    // fetch with parameters is working yay... find a way to use this to get a specific file in a folder, also utilizing serve-index
    fetch("/api/123")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  if (data) {
    icon = data[0];
  }


  return (
    <div className="App">
     <p>{!icon ? "Loading..." : icon}</p>
     <VideoArray />
    </div>
  );
}

export default App;
